import React, { Component } from "react";
import css6 from "./Task6.module.css";

class Task6 extends Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [],
      isloaded: false,
    };
  }
  componentDidMount() {
    fetch("https://jsonplaceholder.typicode.com/users")
      .then((res) => res.json())
      .then((json) => {
        this.setState({
          isloaded: true,
          itmes: json,
        });
      });
  }
  render() {
    const { isloaded, items } = this.state;
    if (!isloaded) {
      return <div>Loading...</div>;
    } else {
      return (
        <div className={css6.card}>
          <h3>Task 6</h3>
          <ul>
            {items.map((item) => (
              <li key={item.id}>
                {item.name} | {item.email}
              </li>
            ))}
          </ul>
        </div>
      );
    }
  }
}

export default Task6;

/* Task 6
